import React from "react";
import Header from "../Header/Header";
import Main from "../Main/Main";
import Navigation from "../Navigation/Navigation";
import Footer from "../Footer/Footer";

function App() {
  return (
    <div className="App">
      <div className="body">
        <div className="page">
          <Header />
          <Navigation />
          <Main />
          <Footer />
        </div>
      </div>
    </div>
  );
}

export default App;
